import React, { useState } from "react";
import { Col, Container, Row } from "react-bootstrap";
import { ReactComponent as Hashtag } from "../assets/hashtag.svg";
function HomeScreen() {
    let [x, setX] = useState(1)
    
    let notes = [
        {
            name: "Wash car",
            description : "Spala masina!",
            id: 1
        },
        {
            name: "Empty fridge",
            description : "To do ",
            id: 2
        },
        {
            name: "To do ",
            description : "To do ",
            id: 3
        },
        {
            name: "To do ",
            description : "To do ",
            id: 4
        },
        {
            name: "To do ",
            description : "To do ",
            id: 5
        }
    ]

    return (
        <div style={{ background: "black", width: "100vw", height: "100vh", position: "relative", display: "flex", alignItems: "center", justifyContent: "center" }}>
            <Container style={{ background: "white", width: "30%", height: "80%" }}>
                <Row style={{ borderBottom: "1px solid #e6e6e6", padding: "5px" }}>
                    <strong>
                        My Notes
                    </strong>
                </Row>

                <Row>
                    <Col md={2} >
                        <Hashtag />
                    </Col>
                    <Col md={2}>
                        Notes
                    </Col>
                    <Col md={6} style={{ display: "flex", alignItems: "end", justifyContent: "flex-end" }}>
                        0
                    </Col>
                </Row>
                <div>
                    {
                        notes.map((note) => {
                            return <p>{note.name}</p>
                        })
                    }
                </div>
                {x } <br/>
                <button onClick={() => {setX(x+1)}}>
                    Increase value
                </button>
            </Container>
        </div>
    )
}
export default HomeScreen
